import { favoriteListMock } from 'mocks';
import './App.css';

function App() {
  return (
    <>
      <div
        style={{
          display: 'flex',
          columnGap: '30px',
          rowGap: '20px',
        }}
      >
        {favoriteListMock.map((favoriteListItem) => (
          <FavoriteItem favoriteListItem={favoriteListItem} />
        ))}
      </div>
    </>
  );
}

export default App;
